import React from "react";
import web from "../src/images/homepage2.png";
import {NavLink} from "react-router-dom";
import Comm from "./commomComm";


const About = () => {
  return (
    <>
      <Comm 
      name="Welcome to About page" 
      imgsrc={web} 
      visit="/contact" 
      btname="Contact Now" />
    </>
  );
};

export default About;
